import React from 'react';

import { Container, Title } from './styles';

export default function DeliveryManAdd() {
  return (
    <>
      <Container>
        <Title>
          <strong>Cadastro de entregadores</strong>

          <aside>
            <button type="button">VOLTAR</button>
            <button type="button">SALVAR</button>
          </aside>
        </Title>
      </Container>
    </>
  );
}
